import React, { useState } from 'react';
import Map from './Map';
import SimpleMap from './SimpleMap';
import ZoomableMap from './ZoomableMap';
import MinimalZoomMap from './MinimalZoomMap';
import NativeZoomMap from './NativeZoomMap';
import NativeZoomMapWithPM25 from './NativeZoomMapWithPM25';
import TrendChart from './TrendChart';
import MultiTrendCharts from './MultiTrendCharts';
import ErrorBoundary from './ErrorBoundary';
import './App.css';

function App() {
  const [selectedCities, setSelectedCities] = useState([]);
  const [mode, setMode] = useState('compare'); // 'compare' or 'multi'
  const [mapType, setMapType] = useState('nativePM25'); // 'original', 'simple', 'zoomable', 'minimal', 'native', 'nativePM25'

  // 选择或取消城市
  const handleCitySelect = (city) => {
    setSelectedCities(prev => {
      const exists = prev.find(c => c.city === city.city && c.country === city.country);
      if (exists) {
        // 如果已选，点击则移除
        return prev.filter(c => !(c.city === city.city && c.country === city.country));
      }
      const max = mode === 'multi' ? 3 : 2;
      if (prev.length === max) return prev;
      return [...prev, city];
    });
  };

  // 切换模式时清空已选城市
  const handleModeChange = (newMode) => {
    setMode(newMode);
    setSelectedCities([]);
  };

  return (
    <div className="App">
      <h1>World PM2.5 Trend</h1>
      <div style={{textAlign: 'center', marginBottom: 16}}>
        <button onClick={() => handleModeChange('compare')} disabled={mode === 'compare'}>Compare Mode</button>
        <button onClick={() => handleModeChange('multi')} disabled={mode === 'multi'}>Multi Mode</button>
        <div style={{marginLeft: 10, display: 'inline-block'}}>
          <button 
            onClick={() => setMapType('native')} 
            style={{backgroundColor: mapType === 'native' ? '#007bff' : '#f8f9fa', color: mapType === 'native' ? 'white' : 'black'}}
          >
            Native Zoom
          </button>
          <button 
            onClick={() => setMapType('minimal')} 
            style={{marginLeft: 5, backgroundColor: mapType === 'minimal' ? '#007bff' : '#f8f9fa', color: mapType === 'minimal' ? 'white' : 'black'}}
          >
            Minimal Zoom
          </button>
          <button 
            onClick={() => setMapType('zoomable')} 
            style={{marginLeft: 5, backgroundColor: mapType === 'zoomable' ? '#007bff' : '#f8f9fa', color: mapType === 'zoomable' ? 'white' : 'black'}}
          >
            Full Zoom
          </button>
          <button 
            onClick={() => setMapType('simple')} 
            style={{marginLeft: 5, backgroundColor: mapType === 'simple' ? '#007bff' : '#f8f9fa', color: mapType === 'simple' ? 'white' : 'black'}}
          >
            Simple Map
          </button>
          <button 
            onClick={() => setMapType('original')} 
            style={{marginLeft: 5, backgroundColor: mapType === 'original' ? '#007bff' : '#f8f9fa', color: mapType === 'original' ? 'white' : 'black'}}
          >
            Original Map
          </button>
        </div>
      </div>
      <ErrorBoundary>
        {mapType === 'native' ? (
          <NativeZoomMap onCitySelect={handleCitySelect} selectedCities={selectedCities} maxCities={mode === 'multi' ? 3 : 2} />
        ) : mapType === 'minimal' ? (
          <MinimalZoomMap onCitySelect={handleCitySelect} selectedCities={selectedCities} maxCities={mode === 'multi' ? 3 : 2} />
        ) : mapType === 'zoomable' ? (
          <ZoomableMap onCitySelect={handleCitySelect} selectedCities={selectedCities} maxCities={mode === 'multi' ? 3 : 2} />
        ) : mapType === 'simple' ? (
          <SimpleMap onCitySelect={handleCitySelect} selectedCities={selectedCities} maxCities={mode === 'multi' ? 3 : 2} />
        ) : (
          <Map onCitySelect={handleCitySelect} selectedCities={selectedCities} maxCities={mode === 'multi' ? 3 : 2} />
        )}
      </ErrorBoundary>
      {mode === 'compare'
        ? <TrendChart selectedCities={selectedCities} />
        : <MultiTrendCharts selectedCities={selectedCities} />}
    </div>
  );
}

export default App;
